import { Switch, Route } from "react-router-dom";
import Header from "./Header";
import NotFound from "./NotFound";

import Home from "../components/Home";
import CreateDeckButton from "../components/Deck/CreateDeckButton";
import DeckList from "../components/Deck/DeckList";
import FillDeckForm from "../components/Deck/FillDeckForm";
import SingleDeckView from "../components/Deck/SingleDeckView";
import AddCard from "../components/Card/AddCard";
import UpdateCard from "../components/Card/UpdateCard";
import EditDeck from "../components/Deck/EditDeck";

function Layout() {




  return (
    <>
      <Header />
      <div className="container">
        {/* TODO: Implement the screen starting here */}

        <Route exact path={"/"}>
          <CreateDeckButton />
          <DeckList />
        </Route> 


        <Route exact path={"/decks/new"}>
          <FillDeckForm/>
        </Route> 

{/*         
        <Route path={"/path1"}>
          <DeckList />
        </Route>
         */}


        <Route exact path="/decks/:deckId">
          <SingleDeckView />
         </Route>

         <Route exact path="/decks/:deckId/edit">
          <EditDeck />
         </Route>

         <Route exact path="/decks/:deckId/study">
          <StudyDeck />
        </Route>

         <Route exact path="/decks/:deckId/cards/new">
          <AddCard />
         </Route>

         <Route exact path="/decks/:deckId/cards/:cardId/edit">
          <UpdateCard />
        </Route>


      </div>
    </>
  );
}

export default Layout;
